<!DOCTYPE html>
<html>
<head>
<meta name="viewport" content="width=device-width, initial-scale=1">
<style>
/* width */
::-webkit-scrollbar {
  width: 16px;
  height: 2px;
}

/* Track */
::-webkit-scrollbar-track {
  background: linear-gradient(90deg, #595959 1px, #666 1px, #626262 0,#111);
  border-radius: 10px;
}
 
/* Handle */
::-webkit-scrollbar-thumb {
  background: #434343;
  border-radius: 16px;
  box-shadow: inset 3px 2px 2px hsl(0deg 0% 100% / 25%), inset -3px -3px 2px rgb(0 0 0 / 25%);
}

/* Handle on hover */
::-webkit-scrollbar-thumb:hover {
  background: #f460; 
}
</style>
</head>   

<body>

<h2>Custom Scrollbar Example</h2>

<p><strong>Note:</strong> The -webkit-scrollbar is not supported in Firefox or in Edge, prior version 79.</p>

